import React from 'react';
import './dashboard.css';

const Dashboard = () => {
  return (
    <div class='text-center'>
      <div class='row'>
        {/* inibuat menu  */}
        <div class='col-2'>

        <h5>Menu</h5>
          <ul className='list-unstyled'>
            <li><a href='/dashboard' className='text-decoration-none'>Dashboard</a></li>
            <li><a href='/profile' className='text-decoration-none'>Profile</a></li>
            <li><a href='/settings' className='text-decoration-none'>Settings</a></li>
            <li><a href='/reports' className='text-decoration-none'>Reports</a></li>
            <li><a href='/logout' className='text-decoration-none'>Logout</a></li>
          </ul>
        </div>

        {/* ini buat dashboard */}
        <div class='col-10'>Column 2 </div>
      </div>
    </div>
  );
};

export default Dashboard;
